INSERT INTO `testimony` (`id_tes`, `nom_tes`, `tel_tes`, `mes_tes`, `actif_tes`, `date_tes`) VALUES
(24, 'Clémence Robert', '6700000', 'Je suis ravie d\'avoir choisi FACOP pour ma formation en entrepreneuriat. Les connaissances acquises sont directement applicables et m\'ont aidée à structurer mon entreprise de manière professionnelle. Les ressources fournies et le réseau de contacts sont des atouts majeurs pour avancer dans le monde des affaires.', 1, '2024-09-05 20:34:23'),
(18, 'Marie Dupont', '6700000', 'La formation en entrepreneuriat de FACOP a véritablement transformé ma manière de penser et d\'aborder les affaires. Les modules sont clairs et bien structurés, et les formateurs sont des experts passionnés. Grâce à cette formation, j\'ai pu lancer mon entreprise avec une confiance renouvelée et des stratégies solides.', 1, '2024-09-05 20:30:21'),
(19, 'Jean-Marc Leroy', '6700000', 'FACOP m\'a fourni les outils et les connaissances nécessaires pour passer de l\'idée à la réalité. Les conseils pratiques et les études de cas m\'ont aidé à éviter les pièges courants et à élaborer un plan d\'affaires efficace. Je recommande vivement cette formation à tous ceux qui souhaitent se lancer dans l\'entrepreneuriat', 1, '2024-09-05 20:31:59'),
(22, 'Sophie Martin', '6700000', '\"La formation de FACOP m\'a ouvert les yeux sur des aspects de l\'entrepreneuriat que je n\'avais jamais envisagés. Les ateliers interactifs et le soutien des mentors ont été précieux pour affiner mon projet et le rendre viable. C\'est un excellent investissement pour toute personne sérieuse sur le développement de son entreprise.', 1, '2024-09-05 20:33:16'),
(23, 'Alexandre Lefèvre', '6700000', 'Participer à la formation de FACOP a été une expérience enrichissante. Les sessions étaient bien organisées et les intervenants, très compétents. J\'ai particulièrement apprécié les discussions en groupe et les conseils personnalisés qui m\'ont permis d\'améliorer ma stratégie entrepreneuriale.', 1, '2024-09-05 20:33:53'),
(25, 'Thibault Girard', '6700000', 'Cette formation a surpassé mes attentes. Les instructeurs sont non seulement expérimentés, mais aussi très accessibles et prêts à partager leurs connaissances. J\'ai quitté la formation avec une compréhension approfondie des dynamiques entrepreneuriales et une vision claire de la direction à prendre.', 1, '2024-09-05 20:35:06'),
(26, 'Amélie Fournier', '6700000', 'La formation FACOP est extrêmement bien conçue. Elle couvre tous les aspects essentiels de l\'entrepreneuriat et fournit des outils pratiques pour chaque étape du processus. J\'ai trouvé le contenu très pertinent et les exercices pratiques extrêmement utiles pour appliquer ce que j\'ai appris.', 1, '2024-09-05 20:35:36'),
(27, 'Tamo Henry', '6700000', 'Je recommande chaudement FACOP à quiconque cherche à se lancer dans l\'entrepreneuriat. La formation est complète, avec une approche équilibrée entre théorie et pratique. Les échanges avec les autres participants et les conseils des experts m\'ont permis de mûrir mes idées et d\'établir des bases solides pour mon entreprise.', 1, '2024-09-05 20:36:09');
